import React from "react";
import Task from "./Task";

export default function TaskList({ tasks }) {
  return (
    <div className="taskListContainer">
      <ul>
        {tasks.map((tasks) => (
          <Task name={tasks.name} />
        ))}
      </ul>
    </div>
  );
}
